// src/components/FindWork.js
import React from "react";
import "../styles/FindWork.css";

function FindWork() {
  return (
    <div className="findwork-container">
      <h1>Available Projects</h1>
      <p>Browse through the latest client projects and apply as a freelancer.</p>

      <div className="projects-list">
        <div className="project-card">
          <h3>Logo Design for Startup</h3>
          <p>Looking for a creative designer to design a modern logo.</p>
          <button className="btn primary-btn">Apply Now</button>
        </div>

        <div className="project-card">
          <h3>Web Developer Needed</h3>
          <p>Build a responsive portfolio website using MERN stack.</p>
          <button className="btn primary-btn">Apply Now</button>
        </div>

        <div className="project-card">
          <h3>Mobile App UI Design</h3>
          <p>Design a clean and minimal interface for an Android/iOS app.</p>
          <button className="btn primary-btn">Apply Now</button>
        </div>
      </div>
    </div>
  );
}

export default FindWork;
